    return '<div id="appmsgItem{id}" data-fileId="{file_id}" data-id="{id}" data-msgindex="{msg_index}" class="js_appmsg_item appmsg_item_wrp {if cover}has_thumb{/if}">\n    <div class="first_appmsg_item" {if !isFirst}style="display:none;"{/if} title="{title_tips}">\n        <div class="cover_appmsg_item">\n            <h4 class="appmsg_title"><a class="js_appmsg_title" href="javascript:void(0);" onclick="return false;">{title || \'标题\'}</a></h4>\n            <div class="appmsg_thumb_wrp js_appmsg_thumb" style="background-image:url(\'{cover}\');">\n                <!--<img class="js_appmsg_thumb appmsg_thumb" src="{cover}">-->\n                <div class="appmsg_thumb default">\n                    <i class="icon_appmsg_thumb">封面图片</i>\n                </div>\n            </div>        \n        </div>\n        <div class="appmsg_edit_mask">\n            <a onclick="return false;" class="icon20_common sort_down_white js_down" data-id="{id}" href="javascript:;" title="下移">向下</a>\n        </div>\n    </div>\n    <div class="appmsg_item" {if isFirst}style="display:none;"{/if} title="{title_tips}">\n        <div class="appmsg_thumb_wrp js_appmsg_thumb" style="background-image:url(\'{cover}\');">\n            <div class="appmsg_thumb default">\n                <i class="icon_appmsg_thumb_small">缩略图</i>\n            </div>\n        </div>\n        <h4 class="appmsg_title js_appmsg_title">{title || \'标题\'}</h4>\n        <div class="appmsg_edit_mask">\n            <a onclick="return false;" class="icon20_common sort_up_white   js_up"   data-id="{id}" href="javascript:;" title="上移">向上</a>\n            <a onclick="return false;" class="icon20_common sort_down_white js_down" data-id="{id}" href="javascript:;" title="下移">向下</a>\n            <a onclick="return false;" class="icon20_common del_media_white js_del"  data-id="{id}" href="javascript:;" title="删除">删除</a>\n        </div>\n    </div>\n</div>\n';
